// Dependencies
import React, { Component } from 'react';

class Contact extends Component {
  render() {
    return (
      <div className="Contact">
        <h1 style={{textAlign: 'center'}}>CONTACT PAGE</h1>
        <p>Contrano en Tre' Arroyo' (y los que hagan falta changito), Grandisima Provincia de Nuestra Señora del Buen Aire, de Argentina papá bien de BOKITA</p>
      </div>
    );
  }
}

export default Contact;
